import{_ as e,o as a,c as t,e as o}from"./app.efeddd24.js";const r={},i=o('<h1 id="\u56F0\u4E8E\u60F3\u50CF-\u6240\u4EE5\u56F0\u4E8E\u7CFB\u7EDF" tabindex="-1"><a class="header-anchor" href="#\u56F0\u4E8E\u60F3\u50CF-\u6240\u4EE5\u56F0\u4E8E\u7CFB\u7EDF" aria-hidden="true">#</a> \u56F0\u4E8E\u60F3\u50CF, \u6240\u4EE5\u56F0\u4E8E\u7CFB\u7EDF</h1><h2 id="\u5173\u4E8E\u56DE\u590D" tabindex="-1"><a class="header-anchor" href="#\u5173\u4E8E\u56DE\u590D" aria-hidden="true">#</a> \u5173\u4E8E\u56DE\u590D</h2><p>\u4ECA\u5929\u53D1\u4E86\u300A\u5916\u5356\u548C\u8D27\u62C9\u62C9 -- \u6211\u4EEC\u4E0D\u5FC5\u56F0\u5728\u7CFB\u7EDF\u4E2D\u300B\u4E00\u6587, \u6536\u5230\u4E86\u8FD9\u6837\u4E00\u6761\u56DE\u590D.</p><blockquote><p>\u6211\u89C9\u5F97...\u8FFD\u6C42\u9053\u5FB7\u4E0D\u9053\u5FB7\u7684...\u7CFB\u7EDF\u4E0D\u7CFB\u7EDF\u7684...\u592A\u865A\u3002\u7CFB\u7EDF\u65E2\u7136\u5B58\u5728\uFF0C\u5B83\u5FC5\u7136\u6709\u5B83\u5B58\u5728\u7684\u5FC5\u8981\uFF0C\u4E0D\u70B9\u5916\u5356\u7684\u8BDD\uFF0C\u5916\u5356\u5C0F\u54E5\u4E0D\u5C31\u6CA1\u6709\u6536\u5165\u4E86\u5417\uFF0C\u56E0\u564E\u5E9F\u98DF\u3002\u5176\u5B9E\u4E0D\u5982\u591A\u4F53\u8C05\u4E00\u4E0B\u522B\u4EBA\uFF0C\u4F46\u4F53\u8C05\u8FD9\u79CD\u4E8B\u60C5\u4E0D\u5BB9\u6613\u5728\u4E8E\uFF0C\u5927\u73AF\u5883\u4E0B\uFF0C\u5927\u5BB6\u90FD\u5728\u4E89\u62A2\u6BD4\u8F83\uFF0C\u6CA1\u6709\u8FD9\u4E2A\u6C1B\u56F4\uFF1A\u6211\u90FD\u4E0D\u591F\uFF0C\u51ED\u4EC0\u4E48\u8981\u7ED9\u4F60\uFF1F\u4F46\u4EBA\u5FC3\u4E0D\u8DB3\uFF0C\u6C38\u8FDC\u4E0D\u591F\u3002</p></blockquote><p>\u770B\u5230\u8FD9\u6761\u56DE\u590D, \u6211\u672C\u80FD\u7684\u5C31\u60F3\u56DE\u5E94: \u8FD9\u4E2A\u56DE\u590D\u7684\u5185\u5BB9\u4F3C\u4E4E\u90FD\u548C\u672C\u6587\u5173\u7CFB\u4E0D\u5927. \u9996\u5148, \u8FD9\u7BC7\u6587\u7AE0\u5373\u6CA1\u6709\u4EC0\u4E48\u9053\u5FB7\u8003\u91CF, \u4E5F\u6CA1\u600E\u4E48\u63D0\u5230\u7CFB\u7EDF. \u8BF4\u5230\u9053\u5FB7, \u4EC5\u4EC5\u662F\u62FF stella \u5173\u4E8E\u5916\u5356\u662F\u4E0D\u662F\u6709\u9053\u5FB7\u7771\u75B5\u7684\u95EE\u9898\u4F5C\u4E86\u8BF4\u9898\u7684\u5F15\u5B50; \u8BF4\u5230\u7CFB\u7EDF ( \u5176\u5B9E\u4E5F\u53EA\u5728\u6807\u9898\u91CC\u63D0\u5230 &quot;\u7CFB\u7EDF&quot; \u4E24\u4E2A\u5B57 ) \u4E5F\u4EC5\u4EC5\u56E0\u4E3A\u6709\u597D\u4E9B\u4E2A\u5173\u4E8E\u5916\u5356\u548C\u8D27\u62C9\u62C9\u7684\u6587\u7AE0\u4EE5 \u300A\u56F0\u4E8E\u7CFB\u7EDF\u4E2D\u300B\u4E3A\u9898, \u6211\u8D77\u8FD9\u4E2A\u540D\u5B57\u6765\u5F3A\u8C03\u6211\u4EEC\u5927\u53EF\u6709\u53E6\u4E00\u4E2A\u89C6\u89D2\u6765\u8FD9\u4E2A\u95EE\u9898. \u5176\u6B21, \u5728\u8FD9\u7BC7\u6587\u7AE0\u91CC, \u6211\u4E5F\u6CA1\u6709\u63D0\u5021\u4E0D\u8981\u70B9\u5916\u5356, \u800C\u4EC5\u4EC5\u662F\u8BF4\u522B\u62FF\u5916\u5356\u505A\u65E5\u5E38\u7684\u5C31\u9910\u65B9\u5F0F, \u8FD9\u610F\u601D\u5927\u6982\u7C7B\u4F3C\u4E8E, &quot;\u522B\u62FF\u96F6\u98DF\u5F53\u996D\u5403&quot;.</p><p>\u5982\u679C\u5C31\u662F\u60F3\u505A\u6B64\u56DE\u5E94, \u53E6\u5199\u4E00\u7BC7\u6587\u7AE0\u5F53\u7136\u662F\u5C0F\u9898\u5927\u4F5C\u4E86. \u6211\u4E4B\u6240\u4EE5\u8981\u518D\u5199\u4E00\u7BC7\u6587\u7AE0, \u662F\u5728\u7EC6\u7EC6\u60F3\u8FD9\u4E2A\u56DE\u590D\u65F6, \u53D1\u73B0\u4E86\u8BF8\u591A\u6709\u8DA3\u7684\u7591\u95EE. \u5728\u8BD5\u56FE\u56DE\u7B54\u8FD9\u4E9B\u7591\u95EE\u65F6, \u6211\u53D1\u73B0\u6211\u4F3C\u4E4E\u80FD\u4F5C\u51FA\u4E9B\u66F4\u6709\u610F\u4E49\u7684\u56DE\u5E94\u6765.</p><p>\u6240\u4EE5\u56DE\u5E94\u8FD9\u4E2A\u56DE\u590D\u7684\u8FC7\u7A0B, \u5176\u5B9E\u5C31\u662F\u7406\u89E3\u8FD9\u56DE\u590D\u7684\u8FC7\u7A0B.</p><h2 id="\u8FFD\u95EE\u56DE\u590D" tabindex="-1"><a class="header-anchor" href="#\u8FFD\u95EE\u56DE\u590D" aria-hidden="true">#</a> \u8FFD\u95EE\u56DE\u590D</h2><p>\u8BA9\u6211\u4EEC\u6765\u7EC6\u7EC6\u770B\u8FD9\u4E2A\u56DE\u590D, \u5B83\u5927\u6982\u8BF4\u4E86\u4E09\u4E2A\u610F\u601D:</p><ol><li>\u9053\u5FB7\u548C\u7CFB\u7EDF\u592A\u865A</li><li>\u4E0D\u70B9\u5916\u5356\u4F1A\u5BFC\u81F4\u5916\u5356\u5C0F\u54E5\u6CA1\u6709\u6536\u5165, ( \u6240\u4EE5\u4E3B\u5F20\u4E0D\u70B9\u5916\u5356\u662F\u56E0\u564E\u5E9F\u98DF ).</li><li>\u56E0\u4E3A\u4EBA\u5FC3\u4E0D\u8DB3, \u6240\u4EE5\u6709 &quot;\u6211\u90FD\u4E0D\u591F, \u51ED\u4EC0\u4E48\u8981\u7ED9\u4F60&quot; \u7684\u6C1B\u56F4, \u6240\u4EE5\u5927\u5BB6\u90FD\u5728\u4E89\u62A2, \u6240\u4EE5\u4F53\u8C05\u5F88\u96BE.</li></ol><p>\u731B\u7684\u4E00\u770B, \u4F1A\u89C9\u5F97\u662F\u4E09\u4E2A\u54EA\u8DDF\u54EA\u90FD\u6328\u7740\u7684\u666E\u904D\u89C2\u70B9. \u4F46\u7A0D\u5FAE\u63A8\u6572\u4E00\u4E0B, \u5C31\u89C9\u5F97\u8FD9\u4E09\u4E2A &quot;\u666E\u904D\u89C2\u70B9&quot; \u5C3D\u662F\u53EF\u7591\u4E4B\u5904.</p><h3 id="\u5173\u4E8E-\u592A\u865A-\u7684\u7591\u95EE" tabindex="-1"><a class="header-anchor" href="#\u5173\u4E8E-\u592A\u865A-\u7684\u7591\u95EE" aria-hidden="true">#</a> \u5173\u4E8E &quot;\u592A\u865A&quot; \u7684\u7591\u95EE</h3><p>\u9053\u5FB7\u592A\u865A\u52C9\u5F3A\u8FD8\u80FD\u8BA9\u4EBA\u7406\u89E3, \u4E3A\u4EC0\u4E48\u89C9\u5F97\u7CFB\u7EDF\u592A\u865A? \u6211\u5199\u5728\u6587\u7AE0\u7684\u8F6F\u4EF6\u8FD0\u884C\u5728 linux \u7CFB\u7EDF\u91CC; \u4F60\u770B\u6587\u7AE0\u7684\u624B\u673A\u8981\u4E48\u662F\u5B89\u5353\u7CFB\u7EDF, \u8981\u4E48\u662F ios \u7CFB\u7EDF; \u6211\u4EEC\u4E00\u51FA\u95E8, \u5C31\u8981\u4F7F\u7528\u516C\u5171\u4EA4\u901A\u7CFB\u7EDF; \u4E0D\u5C0F\u5FC3\u72AF\u4E86\u4E8B\u8FD8\u5F97\u548C\u516C\u68C0\u6CD5\u7CFB\u7EDF\u6253\u4EA4\u9053. \u5C31\u4E0D\u6500\u626F\u592A\u8FDC, \u5916\u5356\u6709\u5916\u5356\u7CFB\u7EDF, \u8D27\u62C9\u62C9\u6709\u8D27\u62C9\u62C9\u7684\u7CFB\u7EDF, \u8FD9\u4E9B\u4E2A\u7CFB\u7EDF\u4F60\u770B\u89C1\u6478\u5F97\u7740, \u4F60\u4E0E\u5B83\u4EA4\u4E92, \u5B83\u5C31\u7ED9\u4F60\u53CD\u9988. \u8FD9\u4E48\u5B9E\u5728\u7684\u4E1C\u897F, \u600E\u4E48\u4F1A\u6709\u4EBA\u89C9\u5F97\u5B83\u592A\u865A\u4E86?</p><h3 id="\u5173\u4E8E-\u6CA1\u6536\u5165-\u7684\u7591\u95EE" tabindex="-1"><a class="header-anchor" href="#\u5173\u4E8E-\u6CA1\u6536\u5165-\u7684\u7591\u95EE" aria-hidden="true">#</a> \u5173\u4E8E &quot;\u6CA1\u6536\u5165&quot; \u7684\u7591\u95EE</h3><p>\u4E0D\u70B9\u5916\u5356\u4F1A\u5BFC\u81F4\u5916\u5356\u5C0F\u54E5\u6CA1\u6709\u6536\u5165, \u8FD9\u4F3C\u4E4E\u662F\u5408\u4E4E\u7ECF\u6D4E\u5B66\u539F\u7406\u7684\u9053\u7406: \u9700\u6C42\u4EA7\u751F\u5C31\u4E1A, \u627C\u6740\u4E86\u9700\u6C42\u5C31\u51CF\u5C11\u4E86\u5C31\u4E1A. \u5F53\u7136, \u4ECE\u6700\u62BD\u50CF\u7684\u9053\u7406\u5C42\u9762\u53EF\u4EE5\u8FD9\u6837\u63A8\u5BFC, \u4F46\u6211\u771F\u7684\u5F88\u6000\u7591\u56E0\u6B64\u5C31\u4F1A\u6709\u76F8\u4FE1 &quot;\u4E0D\u70B9\u5916\u5356\u5916\u5356\u5C0F\u54E5\u5C31\u4F1A\u6CA1\u6709\u6536\u5165&quot;. \u5047\u5982\u56E0\u4E3A\u67D0\u79CD\u4E0D\u53EF\u6297\u529B, \u5916\u5356\u8FD9\u4E2A\u884C\u4E1A\u7A81\u7136\u6D88\u5931\u4E86, \u6240\u6709\u7684\u5916\u5356\u5C0F\u54E5\u4F1A\u56E0\u6B64\u800C\u88AB\u997F\u6B7B\u4E48? \u5F53\u7136\u4E0D\u4F1A\u554A, \u4ED6\u4EEC\u4F1A\u53BB\u5E72\u522B\u7684\u5DE5\u4F5C. \u5C31\u5982\u4FD7\u8BDD\u8BF4\u7684, \u6CA1\u6709\u88AB\u5C3F\u618B\u6B7B\u7684\u4EBA.</p><p>\u6216\u8BB8, \u6211\u4EEC\u8FD8\u53EF\u4EE5\u53CD\u9A73, \u6240\u8C13 &quot;\u6CA1\u6709\u6536\u5165&quot; \u662F\u4E00\u79CD\u5938\u5F20\u7684\u4FEE\u8F9E, \u8FD9\u8BDD\u771F\u6B63\u60F3\u8BF4\u7684\u662F: \u5BF9\u4E8E\u54EA\u4E9B\u5916\u5356\u5C0F\u54E5, \u5916\u5356\u662F\u4ED6\u4EEC\u80FD\u9009\u62E9\u7684\u6700\u597D\u7684\u5DE5\u4F5C, \u5982\u679C\u4E0D\u8BA9\u4ED6\u4EEC\u53BB\u9001\u9910, \u4ED6\u4EEC\u53EA\u4F1A\u6D3B\u7684\u66F4\u60E8. \u5F53\u7136, \u5982\u679C\u4ECE &quot;\u5E02\u573A\u4F1A\u5BF9\u8D44\u6E90\u8FDB\u884C\u6700\u4F18\u7684\u914D\u7F6E&quot; \u7684\u7ECF\u6D4E\u5B66\u539F\u7406, \u63A8\u5BFC\u51FA &quot;\u56E0\u4E3A\u5916\u5356\u5C0F\u54E5\u5728\u5E02\u573A\u4E2D\u81EA\u613F\u9009\u62E9\u4E86\u5916\u5356\u884C\u4E1A, \u90A3\u4E48\u8BF4\u660E\u5916\u5356\u884C\u4E1A\u5BF9\u5916\u5356\u5C0F\u54E5\u662F\u6700\u4F18\u7684\u5DE5\u4F5C\u65B9\u6848&quot;, \u4F3C\u4E4E\u4E5F\u80FD\u8BF4\u7684\u901A.</p>',16),h=[i];function u(d,c){return a(),t("div",null,h)}var l=e(r,[["render",u],["__file","\u56F0\u4E8E\u60F3\u50CF.html.vue"]]);export{l as default};
